import React, { useState } from "react";
import Axios from "axios";
import { Form } from "react-bootstrap";
import { Button } from "react-bootstrap";

function AddData() {
  const [fullname, setFullname] = useState("");
  const [stdid, setStdid] = useState(0);
  const [level, setLevel] = useState("");
  const [subj, setSubj] = useState("");
  const [about, setAbout] = useState(0);
  const [employeeList, setEmployeeList] = useState([]);

  const getEmployees = () => {
    Axios.get("http://localhost:3001/employees").then((response) => {
      setEmployeeList(response.data);
    });
  };

  const addEmployee = () => {
    Axios.post("http://localhost:3001/create", {
      fullname: fullname,
      stdid: stdid,
      level: level,
      subj: subj,
      about: about,
    }).then(() => {
      setEmployeeList([
        ...employeeList,
        {
          fullname: fullname,
          stdid: stdid,
          level: level,
          subj: subj,
          about: about,
        },
      ]);
    });
  };

  return (
    <div className="App container">
      <h1>Employees Information</h1>
      <div className="information">
        <form action="">
          <div className="mb-3">
            <label className="form-label" htmlFor="name">
              Name:
            </label>
            <input
              type="text"
              className="form-control"
              placeholder="Enter name"
              onChange={(event) => {
                setFullname(event.target.value);
              }}
            />
          </div>
          <div className="mb-3">
            <label htmlFor="age">Age:</label>
            <input
              type="number"
              className="form-control"
              placeholder="Enter age"
              onChange={(event) => {
                setStdid(event.target.value);
              }}
            />
          </div>
          <div className="mb-3">
            <label htmlFor="country">Country:</label>
            <input
              type="text"
              className="form-control"
              placeholder="Enter country"
              onChange={(event) => {
                setLevel(event.target.value);
              }}
            />
          </div>
          <div className="mb-3">
            <label htmlFor="Position">Position:</label>
            <input
              type="text"
              className="form-control"
              placeholder="Enter Position"
              onChange={(event) => {
                setSubj(event.target.value);
              }}
            />
          </div>
          <div className="mb-3">
            <label htmlFor="Wage">Wage:</label>
            <input
              type="number"
              className="form-control"
              placeholder="Enter Wage"
              onChange={(event) => {
                setAbout(event.target.value);
              }}
            />
          </div>
          <button onClick={addEmployee} className="btn btn-success">
            Add Employee
          </button>
        </form>
      </div>
      <hr />
      <div className="employees">
        <button className="btn btn-primary" onClick={getEmployees}>
          Show Employees
        </button>
        <br />
        <br />
        {employeeList.map((val, key) => {
          return (
            <div className="employee card" key={key}>
              <div className="card-body text-left">
                <p className="card-text">Name: {val.fullname}</p>
                <p className="card-text">Age: {val.stdid}</p>
                <p className="card-text">Country: {val.level}</p>
                <p className="card-text">Position: {val.subj}</p>
                <p className="card-text">Wage: {val.about}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default AddData;
